INSERT INTO `refinery_page_part_translations` VALUES (1,1,'en','2014-03-05 09:47:56','2014-03-05 09:47:56','<p>Welcome to our site. This is just a place holder page while we gather our content.</p>'),(2,2,'en','2014-03-05 09:47:56','2014-03-05 09:47:56','<p>This is another block of content over here.</p>'),(3,3,'en','2014-03-05 09:47:56','2014-03-12 11:46:40','<h2>Sorry, there was a problem...</h2>\r\n<p>The page you requested was not found.</p>\r\n<p><a href=\"/\">Return to the home page</a>\r\n</p>'),(4,4,'en','2014-03-05 09:47:56','2014-03-13 02:03:07',''),(5,5,'en','2014-03-05 09:47:56','2014-03-05 09:47:56','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus fringilla nisi a elit. Duis ultricies orci ut arcu. Ut ac nibh. Duis blandit rhoncus magna. Pellentesque semper risus ut magna. Etiam pulvinar tellus eget diam. Morbi blandit. Donec pulvinar mauris at ligula. Sed pellentesque, ipsum id congue molestie, lectus risus egestas pede, ac viverra diam lacus ac urna. Aenean elit.</p>'),(6,6,'en','2014-03-05 13:45:50','2014-03-05 13:45:50',''),(7,7,'en','2014-03-05 13:45:50','2014-03-05 13:45:50',''),(8,8,'en','2014-03-05 13:46:18','2014-03-13 02:40:39','<p><a href=\"/uber-uns/mission\" title=\"Mission\"><img src=\"/system/images/W1siZiIsIjIwMTQvMDMvMTMvMTBfMDBfNDFfOTU2X0FUTEFTX0xIQ19DRVJOXzY3MHgzNTUuanBnIl0sWyJwIiwidGh1bWIiLCI0NTB4NDUwPiJdLFsicCIsInN0cmlwIl1d/ATLAS_LHC_CERN_670x355.jpg\" title=\"Atlas Lhc Cern 670x355\" alt=\"Atlas Lhc Cern 670x355\" data-rel=\"450x450\" width=\"450\" height=\"238\" class=\"image-align-left\" /></a>\r\n</p>\r\n<div>\r\n<a href=\"/uber-uns/mission\" title=\"Mission\">\r\n<p style=\"font-size:13px\"><strong>„Particle Fever“</strong>\r\n</p>\r\n<div class=\"color_blue\" style=\"font-size:28px;margin-top:10px;margin-bottom:10px;display:inline-block\">Wis­sen­schaft im Ki­no\r\n</div>\r\n<br />\r\n<div>Es ist eine der wichtigsten wissenschaftlichen Entdeckungen der vergangenen Jahre: Im Juni 2012 gelang den Wissenschaftlern am CERN in Genf der Nachweis des lang gesuchten Higgs-Bosons. Der Kinofilm „Particle Fever“ erzählt die Geschichte des größten Experiments in der Geschichte der Wissenschaft. Leider vorerst nur in amerikanischen Kinos</div>\r\n<br />\r\n<span class=\"color_blue\" style=\"margin-top:60px;display:inline-block\">| Struktur der Materie\r\n</span>\r\n</a>\r\n</div>'),(9,9,'en','2014-03-05 13:46:18','2014-03-05 13:46:18',''),(12,12,'en','2014-03-05 13:55:18','2014-03-05 13:55:18',''),(13,13,'en','2014-03-05 13:55:18','2014-03-05 13:55:18',''),(14,14,'en','2014-03-05 13:55:33','2014-03-05 13:55:33',''),(15,15,'en','2014-03-05 13:55:33','2014-03-05 13:55:33',''),(16,16,'en','2014-03-05 13:55:53','2014-03-05 13:55:53',''),(17,17,'en','2014-03-05 13:55:53','2014-03-05 13:55:53',''),(18,18,'en','2014-03-05 13:56:19','2014-03-12 03:27:42','<p>cdsdfsfdsfdsfds</p>'),(19,19,'en','2014-03-05 13:56:19','2014-03-12 03:27:42','<p class=\"background_gray\">dsfdsfafdafdfs</p>'),(35,35,'en','2014-03-12 03:27:42','2014-03-13 02:41:37',''),(43,43,'en','2014-03-12 08:49:22','2014-03-13 03:33:00','<h2><span class=\"background_blue color_white\" style=\"padding:10px;text-transform: uppercase;\">Wis­sen­schaft und Ge­sell­schaft</span>\r\n</h2>\r\n<h3 style=\"margin-top:30px;\">Wissenschaftscomic zu Fukushima</h3>\r\n<h2 class=\"color_blue\">Hel­fen Al­gen ge­gen Ra­dio­ak­ti­vi­tät?</h2>'),(44,44,'en','2014-03-12 08:49:22','2014-03-13 03:26:56',''),(45,45,'en','2014-03-12 08:49:34','2014-03-12 08:49:34',''),(46,46,'en','2014-03-12 08:49:34','2014-03-12 08:49:34',''),(47,47,'en','2014-03-12 08:49:46','2014-03-12 08:49:46',''),(48,48,'en','2014-03-12 08:49:46','2014-03-12 08:49:46',''),(49,49,'en','2014-03-12 08:49:58','2014-03-12 08:49:58',''),(50,50,'en','2014-03-12 08:49:58','2014-03-12 08:49:58',''),(51,51,'en','2014-03-12 08:50:38','2014-03-12 08:50:38',''),(52,52,'en','2014-03-12 08:50:38','2014-03-12 08:50:38',''),(53,53,'en','2014-03-12 08:51:10','2014-03-12 08:51:10',''),(54,54,'e