INSERT INTO `refinery_page_parts` VALUES (1,1,'Body','<p>Welcome to our site. This is just a place holder page while we gather our content.</p>',0,'2014-03-05 09:47:56','2014-03-05 09:47:56'),(2,1,'Side Body','<p>This is another block of content over here.</p>',1,'2014-03-05 09:47:56','2014-03-05 09:47:56'),(3,2,'Body','<h2>Sorry, there was a problem...</h2>\r\n<p>The page you requested was not found.</p>\r\n<p><a href=\"/\">Return to the home page</a>\r\n</p>',0,'2014-03-05 09:47:56','2014-03-12 11:46:40'),(4,3,'Body','',0,'2014-03-05 09:47:56','2014-03-13 02:03:07'),(5,3,'Side Body','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus fringilla nisi a elit. Duis ultricies orci ut arcu. Ut ac nibh. Duis blandit rhoncus magna. Pellentesque semper risus ut magna. Etiam pulvinar tellus eget diam. Morbi blandit. Donec pulvinar mauris at ligula. Sed pellentesque, ipsum id congue molestie, lectus risus egestas pede, ac viverra diam lacus ac urna. Aenean elit.</p>',1,'2014-03-05 09:47:56','2014-03-05 09:47:56'),(6,4,'Body','',0,'2014-03-05 13:45:50','2014-03-05 13:45:50'),(7,4,'Side Body','',1,'2014-03-05 13:45:50','2014-03-05 13:45:50'),(8,5,'Body','<p><a href=\"/uber-uns/mission\" title=\"Mission\"><img src=\"/system/images/W1siZiIsIjIwMTQvMDMvMTMvMTBfMDBfNDFfOTU2X0FUTEFTX0xIQ19DRVJOXzY3MHgzNTUuanBnIl0sWyJwIiwidGh1bWIiLCI0NTB4NDUwPiJdLFsicCIsInN0cmlwIl1d/ATLAS_LHC_CERN_670x355.jpg\" title=\"Atlas Lhc Cern 670x355\" alt=\"Atlas Lhc Cern 670x355\" data-rel=\"450x450\" width=\"450\" height=\"238\" class=\"image-align-left\" /></a>\r\n</p>\r\n<div>\r\n<a href=\"/uber-uns/mission\" title=\"Mission\">\r\n<p style=\"font-size:13px\"><strong>„Particle Fever“</strong>\r\n</p>\r\n<div class=\"color_blue\" style=\"font-size:28px;margin-top:10px;margin-bottom:10px;display:inline-block\">Wis­sen­schaft im Ki­no\r\n</div>\r\n<br />\r\n<div>Es ist eine der wichtigsten wissenschaftlichen Entdeckungen der vergangenen Jahre: Im Juni 2012 gelang den Wissenschaftlern am CER